-- ----------------------------
-- View structure for summary_kasbon
-- ----------------------------
DROP VIEW IF EXISTS `summary_kasbon`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `summary_kasbon` AS SELECT
	`cash_receipt`.`employee_id` AS `employee_id`,
	sum( `cash_receipt`.`cash_value` ) AS `total_kasbon`,(
	SELECT COALESCE
		( sum( `payment_debt`.`payment_value` ), 0 ) 
	FROM
		`payment_debt` 
	WHERE
		((
				`payment_debt`.`payment_value` > 0 
				) 
		AND ( `payment_debt`.`employee_id` = `cash_receipt`.`employee_id` ))) AS `total_bayar`,(
		COALESCE ( sum( `cash_receipt`.`cash_value` ), 0 ) - (
		SELECT COALESCE
			( sum( `payment_debt`.`payment_value` ), 0 ) 
		FROM
			`payment_debt` 
		WHERE
			((
					`payment_debt`.`payment_value` > 0 
					) 
			AND ( `payment_debt`.`employee_id` = `cash_receipt`.`employee_id` )))) AS `sisa_kasbon` 
FROM
	`cash_receipt` 
GROUP BY
	`cash_receipt`.`employee_id` ;

-- ----------------------------
-- View structure for view_cashflow
-- ----------------------------
DROP VIEW IF EXISTS `view_cashflow`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_cashflow` AS SELECT
	cashflow.id AS id, 
	cashflow.date AS date, 
	cashflow.no_reff AS no_reff, 
	cashflow.type AS type, 
	cashflow.category AS category, 
	cashflow_category.`name` AS category_name, 
	cashflow.description AS description, 
	cashflow.in_value AS in_value, 
	cashflow.out_value AS out_value, 
	cashflow.`status` AS `status`, 
	cashflow.created_at AS created_at, 
	cashflow.created_by AS created_by, 
	users.username AS username, 
	cashflow.shift, 
	payment_methode.`name`
FROM
	(
		(
			(
				cashflow
			)
			LEFT JOIN
			users
			ON 
				(
					(
						cashflow.created_by = users.id_user
					)
				)
		)
		LEFT JOIN
		cashflow_category
		ON 
			(
				(
					cashflow.category = cashflow_category.id
				)
			)
	)
	INNER JOIN
	payment_methode
	ON 
		cashflow.payment_methode = payment_methode.id ;

-- ----------------------------
-- View structure for view_cash_receipt
-- ----------------------------
DROP VIEW IF EXISTS `view_cash_receipt`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_cash_receipt` AS SELECT
	cash_receipt.*, 
	employees.employee_name
FROM
	cash_receipt
	INNER JOIN
	employees
	ON 
		cash_receipt.employee_id = employees.id ;

-- ----------------------------
-- View structure for view_checkout
-- ----------------------------
DROP VIEW IF EXISTS `view_checkout`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_checkout` AS SELECT
	`transactions_details`.`trans_id` AS `trans_id`,
	sum( `transactions_details`.`subtotal` ) AS `subtotal`,
	sum( `transactions_details`.`discount` ) AS `discount`,
	sum( `transactions_details`.`grand_total` ) AS `grand_total`
FROM
	`transactions_details` 
GROUP BY
	`transactions_details`.`trans_id` ;

-- ----------------------------
-- View structure for view_detail_transactions
-- ----------------------------
DROP VIEW IF EXISTS `view_detail_transactions`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_detail_transactions` AS SELECT
	transactions_details.trans_id, 
	transactions_details.product_id, 
	transactions_details.product_detail_id, 
	transactions_details.qty,
	transactions_details.subtotal,
	transactions_details.discount,
	transactions_details.grand_total,
	transactions_details.unit,
	products.`name` AS product_name, 
	products.category_id, 
	products_category.`name` AS category_name, 
	transactions.date, 
	products_details.`name` as product_detail_name
FROM
	transactions_details
	LEFT JOIN
	products
	ON 
		transactions_details.product_id = products.id
	LEFT JOIN
	products_category
	ON 
		products.category_id = products_category.`code`
	LEFT JOIN
	transactions
	ON 
		transactions_details.trans_id = transactions.id
	LEFT JOIN
	products_details
	ON 
		transactions_details.product_detail_id = products_details.id
ORDER BY
	qty DESC ;

