-- ----------------------------
-- View structure for view_payment_trans
-- ----------------------------
DROP VIEW IF EXISTS `view_payment_trans`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_payment_trans` AS SELECT
	`payment_transactions`.`id` AS `id`,
