	`payment_transactions`.`payment_type` AS `payment_type`,
	`payment_methode`.`name` AS `payment_methode_name`,
	`payment_transactions`.`payment_methode` AS `payment_methode`,
	`payment_type`.`name` AS `payment_type_name`,
	`payment_transactions`.`payment_date` AS `payment_date`,
	`payment_transactions`.`payment_value` AS `payment_value`,
	`payment_transactions`.`receive_by` AS `receive_by`,
	`payment_transactions`.`shift` AS `shift` 
FROM
	((
			`payment_transactions`
			JOIN `payment_methode` ON ((
					`payment_transactions`.`payment_methode` = `payment_methode`.`id` 
				)))
		JOIN `payment_type` ON ((
			`payment_transactions`.`payment_type` = `payment_type`.`id` 
	))) ;

-- ----------------------------
-- View structure for view_products_details
-- ----------------------------
DROP VIEW IF EXISTS `view_products_details`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_products_details` AS SELECT
	products_details.id,
	products_details.`name`,
	products_details.product_id,
	products_details.size,
	products_details.cost,
	products_details.specification,
	products_details.unit_price,
	products_details.unit,
	products_details.wholesaler,
	products_details.flag_custom_size,
	products_details.flag_finishing,
	products_details.min_order,
	products_details.based_price,
	products_details.active,
	products_details.created_by,
	products_details.created_at,
	products_details.modified_by,
	products_details.modified_at,
	products_details.deleted_by,
	products_details.deleted_at,
	products.`name` AS `product_name`,
	products.category_id,
	products_category.`code`,
	products_category.`name` AS `category_name` 
FROM
	products_details
	LEFT JOIN products ON products_details.product_id = products.id
	LEFT JOIN products_category ON products.category_id = products_category.`code` ;

-- ----------------------------
-- View structure for view_salary
