DROP VIEW IF EXISTS `view_salary`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_salary` AS SELECT
	salary.id, 
	salary.date, 
	salary.`month`, 
	salary.month_name, 
	salary.`year`, 
	salary.employee_id, 
	employees.employee_name, 
	position.position_name, 
	salary.days_month, 
	salary.leave_allowance, 
	salary.actual_leave, 
	salary.not_pay_day, 
	salary.remain_day, 
	salary.monthly_salary, 
	salary.dayli_salary, 
