DROP VIEW IF EXISTS `view_shift`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_shift` AS SELECT
	shift.id,
	shift.user_id,
	users.username,
	users.full_name,
	shift.date,
	shift.start_shift,
	shift.end_shift,
	shift.qty_transactions,
	shift.qty_income,
