	shift.beginning_balance,
	shift.cash_sales,
	shift.expected_ending_balance,
	shift.cash_payment,
	shift.income,
	shift.expenses,
	shift.ending_balance,
	shift.actual_ending_balance,
	shift.difference,
	shift.ending_by,
	usr.username as ending_shift_user,
	shift.`status`,
