FROM
	shift
	INNER JOIN users ON shift.user_id = users.id_user
	LEFT JOIN users AS usr ON shift.ending_by = usr.id_user ;

-- ----------------------------
-- View structure for view_summary_kasbon
-- ----------------------------
DROP VIEW IF EXISTS `view_summary_kasbon`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_summary_kasbon` AS SELECT
	employees.id,
	employees.employee_name,
	( SELECT COALESCE ( SUM( cash_receipt.cash_value ), 0 ) FROM cash_receipt WHERE cash_receipt.employee_id = employees.id ) AS cash_value,
	( SELECT COALESCE ( sum( payment_debt.payment_value ), 0 ) FROM payment_debt WHERE payment_debt.employee_id = employees.id ) AS total_payment,
	((
		SELECT COALESCE
			( SUM( cash_receipt.cash_value ), 0 ) 
		FROM
			cash_receipt 
		WHERE
			cash_receipt.employee_id = employees.id 
		) - ( SELECT COALESCE ( sum( payment_debt.payment_value ), 0 ) FROM payment_debt WHERE payment_debt.employee_id = employees.id )) AS sisa_kasbon 
FROM
	employees
	LEFT JOIN cash_receipt ON cash_receipt.employee_id = employees.id
	LEFT JOIN payment_debt ON employees.id = payment_debt.employee_id 
WHERE
	cash_receipt.`status` = 'REC' 
GROUP BY
	employees.id ;

