-- ----------------------------
-- View structure for view_summary_payment_debt
-- ----------------------------
DROP VIEW IF EXISTS `view_summary_payment_debt`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_summary_payment_debt` AS SELECT
	payment_debt.id, 
