-- ----------------------------
-- View structure for view_transactions
-- ----------------------------
DROP VIEW IF EXISTS `view_transactions`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_transactions` AS SELECT
	`transactions`.`id` AS `id`,
	`transactions`.`customer_name` AS `customer_name`,
	`transactions`.`date` AS `date`,
	`transactions`.`phone` AS `phone`,
	`transactions`.`subtotal` AS `subtotal`,
	`transactions`.`discount` AS `discount`,
	`transactions`.`grand_total` AS `grand_total`,
	`transactions`.`total_down_payment` AS `total_down_payment`,
	`transactions`.`paid_off` AS `paid_off`,
	`transactions`.`total_payment` AS `total_payment`,
	`transactions`.`balance` AS `balance`,
	`transactions`.`return` AS `return`,
	`transactions`.`cashier` AS `cashier`,
	`cashier`.`username` AS `cashier_name`,
	`transactions`.`shift` AS `shift`,
	`transactions`.`status` AS `status`,
	`transactions`.`notes` AS `notes`,
	`transactions`.`created_by` AS `created_by`,
	`user_create`.`id_user` AS `id_user`,
	`user_create`.`username` AS `created_by_name`,
	`transactions`.`created_at` AS `created_at`,
	`transactions`.`modified_by` AS `modified_by`,
	`transactions`.`modified_at` AS `modified_at`,
	`transactions`.`deleted_by` AS `deleted_by`,
	`transactions`.`deleted_at` AS `deleted_at` 
FROM
	((
			`transactions`
			LEFT JOIN `users` `cashier` ON ((
					`transactions`.`cashier` = `cashier`.`id_user` 
				)))
		JOIN `users` `user_create` ON ((
			`transactions`.`created_by` = `user_create`.`id_user` 
	))) ;

-- ----------------------------
-- View structure for view_trans_details
-- ----------------------------
DROP VIEW IF EXISTS `view_trans_details`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_trans_details` AS SELECT
	`transactions_details`.`id` AS `id`,
	`transactions_details`.`trans_id` AS `trans_id`,
		`transactions`.`date` AS `date`,
	`transactions_details`.`product_id` AS `product_id`,
	`products`.`name` AS `product_name`,
	`transactions_details`.`product_detail_id` AS `product_detail_id`,
	`products_details`.`name` AS `products_detail_name`,
	`transactions_details`.`width` AS `width`,
	`transactions_details`.`length` AS `length`,
	`transactions_details`.`subtotal_size` AS `subtotal_size`,
	`transactions_details`.`total_size` AS `total_size`,
	`transactions_details`.`unit_price` AS `unit_price`,
	`transactions_details`.`price` AS `price`,
	`transactions_details`.`qty` AS `qty`,
	`transactions_details`.`unit` AS `unit`,
	`transactions_details`.`finishing_notes` AS `finishing_notes`,
	`transactions_details`.`subtotal` AS `subtotal`,
	`transactions_details`.`discount` AS `discount`,
	`transactions_details`.`grand_total` AS `grand_total`,
	`transactions_details`.`created_by` AS `created_by`,
	`transactions_details`.`created_at` AS `created_at`,
	`transactions_details`.`modified_by` AS `modified_by`,
	`transactions_details`.`modified_at` AS `modified_at`,
	`transactions_details`.`deleted_by` AS `deleted_by`,
	`transactions_details`.`deleted_at` AS `deleted_at`,
	`transactions_details`.`notes` AS `notes`,
	`transactions_details`.`file_name` AS `file_name`,
	`transactions`.`shift` AS `shift`  
FROM
	(((
				`transactions_details`
				JOIN `transactions` ON ((
						`transactions_details`.`trans_id` = `transactions`.`id` 
					)))
			JOIN `products` ON ((
					`transactions_details`.`product_id` = `products`.`id` 
				)))
		JOIN `products_details` ON (((
					`transactions_details`.`product_detail_id` = `products_details`.`id` 
				) 
	AND ( `products`.`id` = `products_details`.`product_id` )))) ;

-- ----------------------------
-- View structure for _summary_kasbon
-- ----------------------------
DROP VIEW IF EXISTS `_summary_kasbon`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `_summary_kasbon` AS SELECT
	cash_receipt.employee_id,
	sum( cash_receipt.cash_value ) AS total_kasbon,
	sum( payment_debt.payment_value ) AS total_bayar,
	(
		sum(
		IF
			( cash_receipt.cash_value > 0, cash_receipt.cash_value, 0 )) - sum(
		IF
		( payment_debt.payment_value > 0, payment_debt.payment_value, 0 ))) AS sisa_kasbon 
FROM
	cash_receipt
	LEFT JOIN payment_debt ON cash_receipt.employee_id = payment_debt.employee_id 
GROUP BY
	cash_receipt.employee_id ;

SET FOREIGN_KEY_CHECKS = 1;
